import React, { Component } from 'react';
import { connect } from 'react-redux';

import thanks from './style/thanks.css';

class Thanks extends Component {

  render() {
    return (
      <div className={thanks.main}>
        <div style={{textAlign: "center"}}>
          <svg width="323px" height="315px" viewBox="74 0 323 315" className={thanks.svg}>
            <image id="illuminati_s_eye_vector_by_alerinon-d6xgt33" stroke="none" fill="none" x="74" y="0" width="323" height="315" xlinkHref="data:image/png;base64,"></image>
          </svg>
          <div className={thanks.title}>,     <br/>  !</div>
        </div>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
  return {
    basket: state.rooty.basket.basket
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    fromBasket: (item) => {
      dispatch({
        type: 'FROM_BASKET',
        item
      })
    }
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(Thanks)
